// use mixin configuring the font stack
@mixin font($group, $variant: regular, $properties: family weight style, $stack: $font-stack)
    $font-properties: map-deep-get($stack, $group, $variant)

    @if $font-properties
        @each $property, $values in $font-properties
            @if contains($properties, $property)
                font-#{$property}: map-get($font-properties, $property)

// configuring fonts
// header fonts
h1, h2, h3, h4
    @include font(roboto, bold)

// base fonts
p
    @include font(lora, regular)

p.blocknote
    @include font(lora, regular-italic)

a
    @include font(lora, bold)

