    // add color variables
    @each $color, $shades in $colors
        @each $shade, $value in $shades
            --clr-#{$color}-#{$shade}: #{$value}

    // add media query breakpoints variables
    @each $prop, $value in $breakpoints
        --#{$prop}: #{$value}

    // layout variables
    @each $screen-size, $variables in $layout
        @if $screen-size == small
            @each $prop, $value in $variables
                --#{$prop}: #{$value}
        @else
            @media (min-width: 1024px)
                @each $prop, $value in $variables
                    --#{$prop}: #{$value}

    // responsive font-size variables
    @each $screen-size, $font-size in $type-scale
        @if $screen-size == small
            @each $prop, $value in $font-size
                --#{$prop}: #{$value}
        @else
            @media (min-width: 1024px)
                @each $prop, $value in $font-size
                    --#{$prop}: #{$value}

    // add grid variables
